export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},"8KWyLizlIq":{data:{id:1032,attributes:{imdbId:"tt0360556",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZmM1ZGJkZDgtNzBlNS00YjkyLTk3NGEtZTIxMGVkMTk2Yjg1XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"4.9\u002F10"},{Source:"Rotten Tomatoes",Value:"32%"}],item_lang:{data:{id:1695,attributes:{title:d,plot:"In a terrifying care-free future, a young man, Guy Montag, whose job as a fireman is to burn all books, questions his actions after meeting a young woman - and begins to rebel against society.",slug:"fahrenheit-451"}}},books:{data:[{id:5982,attributes:{title:"Ray Bradbury's Fahrenheit 451",description:"A Graphic Adaptation An HBO Original Movie starring Michael B. Jordan (Black Panther), Sofia Boutella (Star Trek: Beyond), and Michael Shannon (The Shape of Water). An Eisner Award Nominee \"Monday burn Millay, Wednesday Whitman, Friday Faulkner, burn 'em to ashes, then burn the ashes.\" For Guy Montag, a career fireman for whom kerosene is perfume, this is not just an official slogan. It is a mantra, a duty, a way of life in a tightly monitored world where thinking is dangerous and books are forbidden. In 1953, Ray Bradbury envisioned one of the world's most unforgettable dystopian futures, and in Ray Bradbury's Fahrenheit 451, the artist Tim Hamilton translates this frightening modern masterpiece into a gorgeously imagined graphic novel. As could only occur with Bradbury's full cooperation in this authorized adaptation, Hamilton has created a striking work of art that uniquely captures Montag's awakening to the evil of government-controlled thought and the inestimable value of philosophy, theology, and literature. Including an original foreword by Ray Bradbury and fully depicting the brilliance and force of his canonic and beloved masterwork, Ray Bradbury's Fahrenheit 451 is an exceptional, haunting work of graphic literature.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HXeODwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2019-04-16",publisher:"Hill and Wang",subtitle:"The Authorized Adaptation"}},{id:5983,attributes:{title:d,description:e,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YwpYhmYGv4cC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"1999-01-01",publisher:"Ithaki Publishing",subtitle:e}},{id:5984,attributes:{title:d,description:"- Critical essays reflecting a variety of schools of criticism - Notes on the contributing critics, a chronology of the author's life, and an index - An introductory essay by Harold Bloom.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ii4xwxU2PYsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Harold Bloom"],firstBook:c,published:"2008-01-01",publisher:"Infobase Publishing",subtitle:"New Edition"}},{id:5985,attributes:{title:"A Pleasure to Burn",description:"Ray Bradbury’s novel Fahrenheit 451 is an enduring masterwork of twentieth-century American literature—a chilling vision of a dystopian future built on the foundations of ignorance, censorship, and brutal repression. The origins and evolution of Bradbury’s darkly magnificent tale are explored in A Pleasure to Burn, a collection of sixteen selected shorter works that prefigure the grand master’s landmark novel. Classic, thematically interrelated stories alongside many crucial lesser-known ones—including, at the collection’s heart, the novellas “Long After Midnight” and “The Fireman”—A Pleasure to Burn is an indispensable companion to the most powerful work of America’s preeminent storyteller, a wondrous confirmation of the inimitable Bradbury’s brilliance, magic . . . and fire.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PxcWeH6QR6cC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2013-05-21",publisher:"Harper Collins",subtitle:"Fahrenheit 451 Stories"}},{id:5986,attributes:{title:"Fahrenheit quatre cent cinquante et un",description:"Roman de science-fiction - incendie - lecture - livre.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7V8InwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2000-01-01",publisher:"Editions Gallimard",subtitle:e}}]}}},meta:{}}},prerenderedAt:1681703557861}}("movie","Ray Bradbury",null,"Fahrenheit 451","","series",1))